import React from "react";
import { useContex } from "react";
import { RoomContex } from "../contex";
import { Title } from "../components/Loading";
export default function RoomsFilter() {
  const context = useContex(RoomContex);
  const {
    handleChange,
    type,
    capacity,
    price,
    minPrice,
    maxPrice,
    minSize,
    maxSize,
    breakfast,
    pets
  } = context;
  return (
    <section className="filter-container">
      <Title title="search rooms"></Title>
      <form action="" className="filter-form"></form>
    </section>
  );
}
